import React from 'react'
import {Link} from 'react-router-dom';

export default function Navbar() {
    return (
        <div>
           <Link to='/'>
               <h2>DASHBOARD</h2>
           </Link>
           <Link to="/cart">
               <div>
                   <h3>CART</h3>
                   <div>1</div>
               </div>
           </Link>
        </div>
    );
};
